import React from 'react'
import { useParams } from 'react-router-dom'

const Blog = (props) => {
  const { blogs } = props
  const id = useParams().id
  const blog = blogs.find(blog => blog.id === id)

  if (!blog) {
    return null
  }
  return(
    <div>
      <h1>{blog.title} by {blog.author}</h1>
      <div>{blog.url}</div>
      <div>{blog.likes} likes</div>

    </div>
  )
}

export default Blog
